'''Unspoiled Earth 1984''' is a calendar that was published by Friends of the Earth (New Zealand) Ltd. with photos of [[New Zealand]] locations by Barney Brewster. The photographs are meant to reflect scenes in [[J.R.R. Tolkien]]'s [[Middle-earth]] with Tolkien-themed titles.<ref>{{webcite|author=|articleurl=https://www.tolkiencalendars.com/ausnz.html|articlename=Australia and New Zealand|website=The Compleat Gyde to Tolkien Calendars|accessed=11 September 2021}}</ref>

